import React, { useEffect, useState } from 'react';
import axios from 'axios';
import {
  Container, Typography, Table, TableHead, TableRow, TableCell, TableBody,
  Paper, TextField, Button, Box, Select, MenuItem, InputLabel, FormControl
} from '@mui/material';

function App() {
  const [tasks, setTasks] = useState([]);
  const [supportTypes, setSupportTypes] = useState([]);
  const [sqiPics, setSqiPics] = useState([]);

  const [form, setForm] = useState({
    title: '',
    description: '',
    status: 'pending',
    supportTypeId: '',
    sqiPicId: ''
  });

  // Ambil semua data awal
  const fetchData = async () => {
    try {
      const [taskRes, typeRes, picRes] = await Promise.all([
        axios.get('http://localhost:4000/api/tasks'),
        axios.get('http://localhost:4000/api/support-types'),
        axios.get('http://localhost:4000/api/sqi-pics')
      ]);
      setTasks(taskRes.data);
      setSupportTypes(typeRes.data);
      setSqiPics(picRes.data);
    } catch (err) {
      console.error(err);
    }
  };

  useEffect(() => {
    fetchData();
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      await axios.post('http://localhost:4000/api/tasks', form);
      setForm({ title: '', description: '', status: 'pending', supportTypeId: '', sqiPicId: '' });
      fetchData();
    } catch (err) {
      console.error('Error creating task:', err);
    }
  };

  return (
    <Container sx={{ mt: 5 }}>
      <Typography variant="h4" gutterBottom>SQI Support Task List</Typography>

      {/* Form Tambah Task */}
      <Paper sx={{ p: 3, mb: 4 }}>
        <Typography variant="h6" gutterBottom>Tambah Task Baru</Typography>
        <Box component="form" onSubmit={handleSubmit} sx={{ display: 'flex', flexWrap: 'wrap', gap: 2 }}>
          <TextField
            label="Judul"
            name="title"
            value={form.title}
            onChange={handleChange}
            required
            fullWidth
          />
          <TextField
            label="Deskripsi"
            name="description"
            value={form.description}
            onChange={handleChange}
            required
            fullWidth
          />
          <FormControl fullWidth>
            <InputLabel>Support Type</InputLabel>
            <Select
              name="supportTypeId"
              value={form.supportTypeId}
              onChange={handleChange}
              required
            >
              {supportTypes.map((s) => (
                <MenuItem key={s.id} value={s.id}>{s.name}</MenuItem>
              ))}
            </Select>
          </FormControl>
          <FormControl fullWidth>
            <InputLabel>PIC SQI</InputLabel>
            <Select
              name="sqiPicId"
              value={form.sqiPicId}
              onChange={handleChange}
              required
            >
              {sqiPics.map((p) => (
                <MenuItem key={p.id} value={p.id}>{p.name}</MenuItem>
              ))}
            </Select>
          </FormControl>
          <Button type="submit" variant="contained">Tambah</Button>
        </Box>
      </Paper>

      {/* Tabel Daftar Task */}
      <Paper>
        <Table>
          <TableHead>
            <TableRow>
              <TableCell>ID</TableCell>
              <TableCell>Judul</TableCell>
              <TableCell>Deskripsi</TableCell>
              <TableCell>Support Type</TableCell>
              <TableCell>PIC SQI</TableCell>
              <TableCell>Status</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {tasks.map((task) => (
              <TableRow key={task.id}>
                <TableCell>{task.id}</TableCell>
                <TableCell>{task.title}</TableCell>
                <TableCell>{task.description}</TableCell>
                <TableCell>{task.SupportType?.name || '-'}</TableCell>
                <TableCell>{task.SqiPic?.name || '-'}</TableCell>
                <TableCell>{task.status}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </Paper>
    </Container>
  );
}

export default App;
